import React, { Component } from 'react';
import {connect} from 'react-redux'
import {Route} from 'react-router-dom'
import Login from './components/Login'
import './App.css';
import {sendingCred} from './actions'
import PrivateRoute from './components/PrivateRoute'
import {Link} from 'react-router-dom';
import Tech from './components/Tech'
import Home from './components/Home'

class App extends Component {
  render() {
    return (
      <div className="App">
        <nav>
          <Link to='/'>Home </Link>
          <Link to='/login'>  Login </Link>
          <Link to='/protected'>  Protected  </Link>
        </nav>

          <Route exact path='/' render={() => <Home />} />
          <Route path ='/login' render= {(...props) => <Login {...props} sendingCred={this.props.sendingCred} />} />
          <PrivateRoute path='/protected' component={Tech} />


      </div>
    );
  }
}

const mapStateToProps = (state) => {
  return({
    ...state,
    token: state.auth.token,

  })
}

export default connect(mapStateToProps, {sendingCred,})(App);
